import React from "react";
import { Col, Row } from "react-bootstrap";
import { CgCPlusPlus } from "react-icons/cg";
import {
  DiPython,
  DiJavascript1,
  DiGit,
  DiJava,
} from "react-icons/di";
import {
  SiMysql,
  SiPostgresql,
  SiWireshark,
  SiGhidra,
  SiIdapro,
  SiNessus,
  SiOpenvpn,
  SiLinux,
  SiMicrosoft,
} from "react-icons/si";
import { FaUserSecret, FaBug, FaShieldAlt } from "react-icons/fa"; // Cybersecurity icons

function Techstack() {
  return (
    <Row style={{ justifyContent: "center", paddingBottom: "50px" }}>
      {/* Programming Languages */}
      <Col xs={4} md={2} className="tech-icons">
        <CgCPlusPlus />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <DiJava />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <DiPython />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <DiJavascript1 />
      </Col>

      {/* Databases */}
      <Col xs={4} md={2} className="tech-icons">
        <SiMysql />
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiPostgresql />
      </Col>

      {/* Cybersecurity Tools (Using Alternative Icons) */}
      <Col xs={4} md={2} className="tech-icons">
        <FaUserSecret /> {/* Ethical Hacking / Cybersecurity */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <FaBug /> {/* Vulnerability Testing */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <FaShieldAlt /> {/* Security Frameworks */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiNmap /> {/* Nmap - Network Scanning */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiWireshark /> {/* Wireshark - Network Analysis */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiBurpsuite /> {/* Burp Suite - Web Security */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiGhidra /> {/* Ghidra - Reverse Engineering */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiIdapro /> {/* IDA Pro - Binary Analysis */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiNessus /> {/* Nessus - Vulnerability Scanning */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiOpenvpn /> {/* VPN Security */}
      </Col>

      {/* OS & Security Environments */}
      <Col xs={4} md={2} className="tech-icons">
        <SiLinux /> {/* Linux for Security Operations */}
      </Col>
      <Col xs={4} md={2} className="tech-icons">
        <SiMicrosoft /> {/* Windows Security */}
      </Col>

      {/* Version Control */}
      <Col xs={4} md={2} className="tech-icons">
        <DiGit />
      </Col>
    </Row>
  );
}

export default Techstack;
